import React, { useState } from 'react';

const Login = () => {
	const [user, setUser] = useState({
		name: '',
		email: '',
		password: '',
	});
	return (
		<section>
			<div className="login">
				<h2>Login</h2>
				<form>
					<input
						type="text"
						name="email"
						id="login-email"
						placeholder="E-mail"
						required
						valu={user.email}
					/>
					<input
						type="password"
						name="password"
						id="login-password"
						required
						valu={user.password}
						autoComplete="true"
					/>
				</form>
			</div>

			<div className="register">
				<h2>Register</h2>
				<form>
					<input type="text" name="name" id="name" />
					<input type="text" name="email" id="email" />
					<input type="password" name="password" id="password" />
				</form>
			</div>
		</section>
	);
};

export default Login;
